import React from "react";
import "./appointment.css";
import data from './list.json'
import { Card, Typography } from "@material-tailwind/react";
export const Appointment =() =>{
    
    const appointments = data.appointments;
    const TABLE_HEAD = ["Patient", "Date", "Time", "Doctor","Injury","Action"];
    return(
        <div>
            <h1> Appointment list</h1>
    <Card className="h-full w-full overflow-scroll">
      <table className="w-full min-w-max table-auto text-left">
 
        <thead>
          <tr>
            {TABLE_HEAD.map((head) => (
              <th key={head} className="border-b border-blue-gray-100 bg-blue-gray-50 p-4">
                <Typography
                  variant="small"
                  color="blue-gray"
                  className="font-normal leading-none opacity-70"
                >
                  {head}
                </Typography>
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {appointments.map((appointments, index) => (
            // <tr key={appointments.patient_name} className="even:bg-blue-gray-50/50">
            //   {/* <td className="p-4"> */}
            <tr key={index} className="even:bg-blue-gray-50/50 border-b border-blue-gray-100">
                <td class="underline underline-offset-1 ">
                <Typography variant="small" color="blue-gray" className="font-normal">
                  {appointments.patient_name}
                  {appointments.mobile_number}
                </Typography>
              </td>
              <td className="p-4">
             
                <Typography variant="small" color="blue-gray" class="font-bold p-2 border-b text-left">
                  {appointments.appointment_date}
                </Typography>
              </td>
              <td className="p-4">
                <Typography variant="small" color="blue-gray" className="font-normal">
                  {appointments.appointment_time}
                </Typography>
              </td>
              <td className="p-4">
              <Typography variant="small" color="blue-gray" className="font-normal">
                {appointments.doctor}
                </Typography>
              </td>
              <td className="p-4">
              <Typography variant="small" color="blue-gray" className="font-normal">
                {appointments.injury}
                </Typography>
              </td>
              <td className="p-4">
              <Typography variant="small" color="blue-gray" className="font-medium">
                <ul>
                <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor" className="w-6 h-6">
              <path strokeLinecap="round" strokeLinejoin="round" d="M12 6.75a.75.75 0 1 1 0-1.5.75.75 0 0 1 0 1.5ZM12 12.75a.75.75 0 1 1 0-1.5.75.75 0 0 1 0 1.5ZM12 18.75a.75.75 0 1 1 0-1.5.75.75 0 0 1 0 1.5Z" />
                  </svg>
                    </ul>
                </Typography>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </Card>
</div>
    );
    
}
